*
   * @desc
   * Flattens an Endless of finite lists into an Endless of elements.
   * That is, remove one level of nesting.
   * @example
   * const e = new Endless(x => [x, x*2]);
   * const f = e.flat();
   * f.take(4); // 0, 0, 1, 2
   * @return {Endless}

